    color: "white",
    fontSize: "small",
    textTransform: "capitalize",
    cursor: "pointer",
    "&:hover": {
        color: "black",
    }
  },
});

const NavItem: React.FC<IProps> = ({ title, }) => {
  const classes = useStyles();
